/**
 * BeforeNavigate接口请求参数
 */
export interface BeforeNavigateRequestBody {
    /**
     * 是否是根元数据
     * @summary
     * 1、 根元数据：metadataId传递基础表单id；
     * 2、非根元数据：metadataId传递扩展表单id；
     */
    isRootMetadata: boolean;
    /**
     * 元数据id
     */
    metadataId: string;
    /**
     * 维度1
     */
    dim1: string;
    /**
     * 维度2
     */
    dim2: string;
}
/**
 * BeforeNavigate接口返回结果
 */
export interface BeforeNavigateReponseBody {
    /**
     * 元数据id
     */
    metadataId: string;
    /**
     * 是否有维度信息
     * @summary
     * 有维度：返回1；
     * 没有维度：返回0；
     */
    withDims: number;
    /**
     * 维度1
     */
    dim1: string;
    /**
     * 维度2
     */
    dim2: string;
}
/**
 * 运行时定制参数
 */
export interface RtcOptions {
    /**
     * 表单元数据id
     */
    metadataId: string;
    /**
     * 是否存在维度信息
     */
    withDims: boolean;
    /**
     * 维度1
     */
    dim1: string;
    /**
     * 维度2
     */
    dim2: string;
}
